}}i:35493;a:5:{s:15:"DETAIL_PAGE_URL";s:24:"/patients/consult/35493/";s:16:"isAnswererClinic";b:1;s:8:"answerer";a:4:{s:5:"image";a:2:{s:8:"ORIGINAL";s:29:"/upload/images/logo-short.png";s:7:"resized";s:29:"/upload/images/logo-short.png";}s:4:"name";s:8:"МЦРМ";s:8:"position";s:0:"";s:2:"id";s:0:"";}s:8:"question";a:7:{s:5:"title";s:12:"Вопрос";s:4:"name";s:10:"Ирина";s:5:"image";s:0:"";s:8:"position";s:0:"";s:4:"text";s:377:"Здравствуйте! Подскажите можно планировать с результатом гомоцестеин 7,51.  Фолиевая результат 44.  Не высокий гомоцестеин ? Предыдущая беременность  с пороком , экзенцефалия.  Первый ребёнок есть , все хорошо .";s:5:"files";s:0:"";s:4:"date";s:20:"27 апреля 2020";}s:6:"answer";a:8:{s:5:"title";s:10:"Ответ";s:4:"name";s:8:"МЦРМ";s:5:"image";a:2:{s:8:"ORIGINAL";s:29:"/upload/images/logo-short.png";s:7:"resized";s:29:"/upload/images/logo-short.png";}s:8:"position";s:0:"";s:4:"text";s:182:"Здравствуйте. Считается, что на момент планирования беременности гомоцистеин должен быть не выше 6.";s:5:"files";s:0:"";s:4:"date";s:20:"27 апреля 2020";s:13:"specialist_id";s:0:"";}}i:17511;a:5:{s:15:"DETAIL_PAGE_URL";s:24:"/patients/consult/17511/";s:16:"isAnswererClinic";b:1;s:8:"answerer";a:4:{s:5:"image";a:2:{s:8:"ORIGINAL";s:29:"/upload/images/logo-short.png";s:7:"resized";s:29:"/upload/images/logo-short.png";}s:4:"name";s:8:"МЦРМ";s:8:"position";s:0:"";s:2:"id";s:0:"";}s:8:"question";a:7:{s:5:"title";s:12:"Вопрос";s:4:"name";s:17:"Светлана ";s:5:"image";s:0:"";s:8:"position";s:0:"";s:4:"text";s:436:"Здравствуйте, подскажите если принимать дюфастон с 10 дня цикла повышает ли риск замершей беременности? Овуляция была на 7 день цикла. Боюсь его принимать, врач назначила, может быть потом избыток прогесткрона если у меня своего достаточно";s:5:"files";s:0:"";s:4:"date";s:14:"22 мая 2019";}s:6:"answer";a:8:{s:5:"title";s:10:"Ответ";s:4:"name";s:8:"МЦРМ";s:5:"image";a:2:{s:8:"ORIGINAL";s:29:"/upload/images/logo-short.png";s:7:"resized";s:29:"/upload/images/logo-